import React from 'react'

export default function IncDec1() {
    const center_div={
        height:"200px",
        width:"200px",
        backgroundColor:"green",
        margin:"20px"
    }
    const heading={
        backgroundColor:"blue",
        position:"relative",
        top:"30px"
    }
    const button = {
       position:"relative",
       top:"30px",
       margin:"10px",
       backgroundColor:"blue" ,
       color:"white",
       borderRadius:"2px"
    }

    return (
        <div style={center_div}>
            <h1 style={heading}>0</h1>
            <button style={button}>Increment</button>
            <button style={button}>Decrement</button>
        </div>
    )
}
